using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class TypeSkill	{		private Guid typeSkillKey;		private string name;		private string description;		private int? orden;		public TypeSkill(){}		public Guid TypeSkillKey		{			get { return typeSkillKey; }			set { typeSkillKey = value; }		}		public string Name		{			get { return name; }			set { name = value; }		}		public string Description		{			get { return description; }			set { description = value; }		}		public int? Orden		{			get { return orden; }			set { orden = value; }		}	}}